import { Stack } from '@mui/material'
import React from 'react'
import pic from '../Media/service.png'

export default function Services() {
  return (
    <div>
      <Stack direction='row' >
        <img src={pic} style={{height:''}}/>
      </Stack>
    </div>
  )
}
